import React from 'react';
import Link from 'next/link';
import redirect from 'next-redirect';
import Error from 'next/error'
import { connect } from 'react-redux';
import { getNews, getOtherNews, getConfig } from '../store/actions/newsActions';
import Template from "../components/Template.js";
import Layout from '../components/MyLayout';

const Index = ({ agent, news }) => {

  return (
    <Layout>
      <h1>Joornalo....{agent}</h1>
      <Link href="/section/[section]/[date]/[id]" as="/section/world-middleeast/2020-01-11/iraq-iran-us-troops-4c50e545-539e-4893-b505-1edc2de3c988">
        <a>News link</a>
      </Link>
    </Layout>
  )
};

Index.getInitialProps = async function (context, agent) {
  const { store } = context;

  if (!process.browser) {
    await store.dispatch(getConfig(context.req));
  }

  await store.dispatch(getNews(section, date, uuid, url, context.req));

  return {
    agent
  };
};


const mapStateToProps = state => ({
  news: state.news.news
});

export default connect(
  mapStateToProps,
  { getNews }
)(Index);
